import DataViewSidebar from '@/layouts/account/slidebar/DataViewSidebar.vue';
import vSelect from 'vue-select';
import AuthenticationService from '@/services/AuthenticationService';
import Vue from 'vue';
export default {
  components: {
    DataViewSidebar: DataViewSidebar,
    vSelect: vSelect
  },
  data: function data() {
    return {
      getAdress: '',
      getPrivateKey: '',
      getWfiKey: '',
      popupAdressWallet: false,
      UserInfo: {},
      popupDeleteActive: false,
      activePrompt: false,
      selectedUser: [],
      fileName: "",
      formats: ["xlsx", "csv", "txt"],
      cellAutoWidth: true,
      selectedFormat: "xlsx",
      headerTitle: ["Id", "Email", "Nick", "Ví", "Tổng thành viên", "Commission"],
      headerVal: ["id", "email", "nickname", "wallet", "memberForAgency", "pending_commission"],
      productsFake: [{
        "id": 1,
        "email": "tesst@gmail.com",
        "nick_name": "SkyPlaza",
        "first_name": "Ares",
        "profile_image": "https://vi.vuejs.org/images/logo.png",
        "money_vn": 100.00,
        "money_btc": 0.000000,
        "money_eth": 0.0100,
        "money_usdt": 1.00,
        "money_paypal": 0.00,
        "manage_supers": 1,
        "pending_commission": 0.00,
        "active_2fa": 0,
        "created_at": "00:00:00 02-04-2021"
      }, {
        "id": 2,
        "email": "tesst@gmail.com",
        "nick_name": "SkyPlaza",
        "first_name": "Ares",
        "profile_image": "https://vi.vuejs.org/images/logo.png",
        "money_vn": 100.00,
        "money_btc": 0.000000,
        "money_eth": 0.0100,
        "money_usdt": 1.00,
        "money_paypal": 0.00,
        "manage_supers": 0,
        "pending_commission": 0.00,
        "active_2fa": 1,
        "created_at": "01:00:00 02-04-2021"
      }],
      itemsPerPage: 10,
      isMounted: false,
      // Data Sidebar
      addNewDataSidebar: false,
      sidebarData: {}
    };
  },
  computed: {
    currentPage: function currentPage() {
      if (this.isMounted) {
        return this.$refs.table.currentx;
      }

      return 0;
    },
    products: function products() {
      return this.productsFake;
    },
    queriedItems: function queriedItems() {
      return this.$refs.table ? this.$refs.table.queriedResults.length : this.productsFake.length;
    }
  },
  methods: {
    clickGetAddress: function clickGetAddress(a, p, w) {
      this.popupAdressWallet = true;

      if (w != '') {
        this.getWfiKey = w;
      } else {
        this.getWfiKey = 'N/A';
      }

      this.getAdress = a;
      this.getPrivateKey = p;
    },
    onCopy: function onCopy() {
      this.$vs.notify({
        text: 'Đã sao chép vào bộ nhớ',
        color: 'success',
        iconPack: 'feather',
        position: 'top-center',
        icon: 'icon-check-circle'
      });
    },
    viewPeopelAgency: function viewPeopelAgency(id, index) {
      var _this = this;

      AuthenticationService.viewMemberAgency(id).then(function (resq) {
        if (resq.data.success) {
          var num = resq.data.data[0].totalPeopel;

          if (num == 0) {
            _this.productsFake[index].sponsor = 'Chưa có thành viên';
          } else {
            _this.productsFake[index].sponsor = _this.formatPrice(num, 0);
          }
        }
      });
    },
    deleteMultiple: function deleteMultiple() {
      for (var i = this.selectedUser.length - 1; i >= 0; i--) {
        var id = this.selectedUser[i]['id'];
        AuthenticationService.deleteMember(id);
        Vue.delete(this.productsFake, i);
      }

      this.selectedUser = [];
      return this.$vs.notify({
        text: 'Đã xóa thành công',
        color: 'success',
        iconPack: 'feather',
        icon: 'icon-check'
      });
    },
    openPopDelete: function openPopDelete(data) {
      this.UserInfo = data;
      this.popupDeleteActive = true;
    },
    deleteUser: function deleteUser(id, index) {
      var _this2 = this;

      AuthenticationService.deleteMember(id).then(function (resp) {
        if (resp.data.success) {
          Vue.delete(_this2.productsFake, index);
          _this2.popupDeleteActive = false;
          return _this2.$vs.notify({
            text: 'Đã xóa thành công',
            color: 'success',
            iconPack: 'feather',
            icon: 'icon-check'
          });
        }
      });
    },
    formatPrice: function formatPrice(value, minimum) {
      var formatter = new Intl.NumberFormat('en-US', {
        //style: 'currency',
        //currency: '',
        minimumFractionDigits: minimum
      });
      return formatter.format(value);
    },
    addMoneyUser: function addMoneyUser(data) {
      data["type"] = 'addMoney';
      this.sidebarData = data;
      this.toggleDataSidebar(true);
    },
    addNewAccount: function addNewAccount() {
      this.sidebarData = {};
      this.toggleDataSidebar(true);
    },
    editUser: function editUser(data) {
      delete data["type"]; // this.sidebarData = JSON.parse(JSON.stringify(this.blankData))

      this.sidebarData = data;
      this.toggleDataSidebar(true);
    },
    getOrderStatusColor: function getOrderStatusColor(status) {
      if (status == 0) return "warning";
      if (status == 1) return "success"; //if(status == 2) return "danger"

      return "warning";
    },
    getOrderStatusColorText: function getOrderStatusColorText(status) {
      if (status == 0) return "Chưa bật";
      if (status == 1) return "Đã bật"; //if(status == 2) return "danger"

      return "Chưa bật";
    },
    toggleDataSidebar: function toggleDataSidebar() {
      var val = arguments.length > 0 && arguments[0] !== undefined ? arguments[0] : false;
      this.addNewDataSidebar = val;
    },
    // export ra file
    exportToExcel: function exportToExcel() {
      var _this3 = this;

      // kiểm tra nếu chưa chọn đối tượng thình sẽ không hiện bản xuất file
      if (this.selectedUser.length == 0) {
        return this.$vs.notify({
          title: 'Xuất dữ liệu',
          text: 'Vui lòng chọn nội dung để hoàn thành',
          color: 'danger',
          iconPack: 'feather',
          icon: 'icon-heart'
        });
      }

      import('@/vendor/Export2Excel').then(function (excel) {
        var list = _this3.selectedUser;

        var data = _this3.formatJson(_this3.headerVal, list);

        excel.export_json_to_excel({
          header: _this3.headerTitle,
          data: data,
          filename: _this3.fileName,
          autoWidth: _this3.cellAutoWidth,
          bookType: _this3.selectedFormat
        });

        _this3.clearFields();
      });
    },
    formatJson: function formatJson(filterVal, jsonData) {
      return jsonData.map(function (v) {
        return filterVal.map(function (j) {
          // Add col name which needs to be translated
          // if (j === 'timestamp') {
          //   return parseTime(v[j])
          // } else {
          //   return v[j]
          // }
          return v[j];
        });
      });
    },
    clearFields: function clearFields() {
      this.fileName = "";
      this.cellAutoWidth = true;
      this.selectedFormat = "xlsx";
    },
    openLoadingInDiv: function openLoadingInDiv() {
      this.$vs.loading({
        container: '#loading-corners',
        type: 'corners',
        scale: 0.6
      });
    }
  },
  created: function created() {
    var _this4 = this;

    // if(!moduleDataList.isRegistered) {
    //   this.$store.registerModule('dataList', moduleDataList)
    //   moduleDataList.isRegistered = true
    // }
    //this.$store.registerModule('dataList', this.productsFake);
    //this.$store.dispatch("dataList/fetchDataListItems")
    //console.log(this.productsFake);
    //console.log(this.$store.state.dataList);
    var token = localStorage.getItem('token');
    this.$store.dispatch('setToken', token);
    AuthenticationService.getListAgency().then(function (resp) {
      _this4.$vs.loading.close('#loading-corners > .con-vs-loading');

      if (resp.data.success == 4) {
        localStorage.removeItem('token');

        _this4.$router.push('/pages/login').catch(function () {});
      } else {
        _this4.productsFake = resp.data.data;
      }
    });
  },
  mounted: function mounted() {
    this.isMounted = true;
    this.openLoadingInDiv();
  }
};
